import { useState } from "react";
import "../css/index.css";
import "../../../css/all.css";
export default function SideBar() {
    let [expand, setExpand] = useState(true);
    let [iconsWidthState, setIconsWidthState] = useState("40px");
    let [iconsPaddState, setIconsPaddState] = useState("0px");
    let [iconTitleOpacity, setIconTitleOpacity] = useState("0");
    let [iconTitleWidth, setIconTitleWidth] = useState("0px");
    let [iconTitlePadd, setIconTitlePadd] = useState("0px");
    function expandSideBar(bool,e) {
        if (bool) {
            console.log("expanded");
            e.currentTarget.children[0].style.cssText = "transform: rotate(180deg)";
            e.currentTarget.parentElement.style.cssText = "width: 200px";
            setTimeout(() => {
                setIconsPaddState("20px");
                setIconsWidthState("100%");
                setIconTitleOpacity("1");
                setIconTitleWidth("100%");
                setIconTitlePadd("22px");
            },200)
        } else {
            const el = e.currentTarget.parentElement;
            setIconsWidthState("40px")
            console.log("decreased")
            e.currentTarget.children[0].style.cssText = "transform: rotate(360deg)"
            setTimeout(() => el.style.cssText = "",50)
            setIconsPaddState("0px");
                setIconsWidthState("100%");
                setIconTitleOpacity("0");
                setIconTitleWidth("0px");
                setIconTitlePadd("0px");

        }
    }
   return (
    <div>
        <div className="main-side-bar">
            <div className="expand-side-bar" onClick={(e) => {expandSideBar(expand,e); expand ? setExpand(false) : setExpand(true)}} >
                <div><i class="fa-solid fa-arrow-right"></i></div>
            </div>
            <div className="icons-container" >
                <div className="icons-section" style={{width: iconsWidthState}}>
                    <div style={{paddingLeft: iconsPaddState}} className="sidebar-icon icon-active"><i class="fa-solid fa-house"></i><span style={{opacity: iconTitleOpacity, width: iconTitleWidth, paddingLeft: iconTitlePadd}}>Home</span></div>
                    <div style={{paddingLeft: iconsPaddState}} className="sidebar-icon"><i class="fa-solid fa-gamepad"></i><span style={{opacity: iconTitleOpacity, width: iconTitleWidth, paddingLeft: iconTitlePadd}}>Play</span></div>
                    <div style={{paddingLeft: iconsPaddState}} className="sidebar-icon"><i class="fa-solid fa-arrow-up-short-wide"></i><span style={{opacity: iconTitleOpacity, width: iconTitleWidth, paddingLeft: iconTitlePadd}}>Ranks</span></div>
                    <div style={{paddingLeft: iconsPaddState}} className="sidebar-icon"><i class="fa-solid fa-rocket"></i><span style={{opacity: iconTitleOpacity, width: iconTitleWidth, paddingLeft: iconTitlePadd}}>Nitro</span></div>
                    <div style={{paddingLeft: iconsPaddState}} className="sidebar-icon"><i class="fa-solid fa-ellipsis"></i><span style={{opacity: iconTitleOpacity, width: iconTitleWidth, paddingLeft: iconTitlePadd}}>More</span></div>
                </div>
                <div className="icons-section" style={{width: iconsWidthState}}>
                    <div className="sidebar-icon icon-settings"><i class="fa-solid fa-gear"></i><span style={{opacity: iconTitleOpacity, width: iconTitleWidth, paddingLeft: iconTitlePadd}}>Settings</span></div>
                    </div>
            </div>
        </div>
    </div>
   )
}
